import React from "react";
import ReactApexChart from "react-apexcharts";

function Bargraph({ graphType }) {
  const series1 = [
    {
      data: [
        {
          x: "jan",
          y: 10,
        },
        {
          x: "category B",
          y: 18,
        },
        {
          x: "category C",
          y: 13,
        },
        {
          x: "category D",
          y: 15,
        },
        {
          x: "category E",
          y: 20,
        },
        {
          x: "category F",
          y: 23,
        },
        {
          x: "category G",
          y: 25,
        },
        {
          x: "category H",
          y: 35,
        },
        {
          x: "category I",
          y: 50,
        },
      ],
    },
  ];

  const series2 = [25,45,35];

  const chartOption = {
    options: {
      chart: {
        width: 500,
        height: 100,
        type: graphType,
      },

    },
  };

  return (
    <div style={{ width: "80%", height: "11vh" }}>
      <ReactApexChart
        options={chartOption.options}
        series={graphType === "bar" ? series1 : series2}
        type={graphType}
      />
    </div>
  );
}

export default Bargraph;
